     /**
     * Generate a random date in the current year.
     *
     * @param int $year
     * @return string
     */
    private function getRandomDate($year)
    {
        $month = rand(1, 12);
        $day = rand(1, cal_days_in_month(CAL_GREGORIAN, $month, $year));
        return Carbon::createFromDate($year, $month, $day)->format('Y-m-d H:i:s');
    }
